webpackJsonp([0x9e1ebc9ae02d],{7468:function(t,e){t.exports={data:{post:{html:"<p>We don't seem to have made an official announcement, but I can say that the 'back soon' sign at <a href=\"http://blogstats.de/\">blogstats.de</a> is <em>not</em> a message of disaster or impending doom. We reorganized the database, and it took longer than we thought. The database is done, the code just has to be adjusted, and I'm sure the blogstats site will be back up first thing in the morning, if not sooner.</p>\n<p><strong>Update:</strong> Well, obviously it's taking the coders longer than we thought to adapt to the new database setup. Data is being collected, we use the same data source at <a href=\"http://blogg.de/\">blogg.de</a>, and I'm sure (I hope) blogstats will be back up shortly. <strong>Update 2:</strong> Just as I posted the update, the page was reactivated. Well, mostly.</p>",fields:{title:"Blogstats down, will be back",date:"23 Nov 2005",url:"https://papascott.de/2005-11-23-blogstats-down-will-be-back/"}}},pathContext:{slug:"/2005-11-23-blogstats-down-will-be-back/",prev:{fields:{title:"Did I mention I love Bruce Springsteen?",date:"19 Nov 2005",slug:"/2005-11-19-did-i-mention-i-love-bruce-springsteen/"}},next:{fields:{title:"Hamsters on the Autobahn",date:"23 Nov 2005",slug:"/2005-11-23-hamsters-on-the-autobahn/"}}}}}});
